BEGIN TRANSACTION;
DROP TABLE IF EXISTS "pkb";
CREATE TABLE IF NOT EXISTS "pkb" (
	"id"	INTEGER NOT NULL,
	"inseminasi_id"	INTEGER,
	"sem_code"	VARCHAR(20) NOT NULL,
	"batch"	VARCHAR(20) NOT NULL,
	"ib_hasil"	INTEGER,
	"tgl_pkb"	DATE,
	PRIMARY KEY("id"),
	FOREIGN KEY("inseminasi_id") REFERENCES "inseminasi"("id")
);
DROP TABLE IF EXISTS "prediksi";
CREATE TABLE IF NOT EXISTS "prediksi" (
	"id"	INTEGER NOT NULL,
	"sapi_id"	INTEGER,
	"estrus"	INTEGER,
	"created_at"	DATETIME,
	"updated_at"	DATETIME,
	FOREIGN KEY("sapi_id") REFERENCES "sapi"("id"),
	PRIMARY KEY("id")
);
DROP TABLE IF EXISTS "inseminasi";
CREATE TABLE IF NOT EXISTS "inseminasi" (
	"id"	INTEGER NOT NULL,
	"sapi_id"	INTEGER,
	"sem_code"	VARCHAR(20) NOT NULL,
	"batch"	VARCHAR(20) NOT NULL,
	"rpf"	INTEGER,
	"perilaku"	INTEGER,
	"ib_ke"	INTEGER,
	"jarak_ib"	INTEGER,
	"laktasi"	INTEGER,
	"tgl_ib"	DATE,
	FOREIGN KEY("sapi_id") REFERENCES "sapi"("id"),
	PRIMARY KEY("id")
);
DROP TABLE IF EXISTS "sapi";
CREATE TABLE IF NOT EXISTS "sapi" (
	"id"	INTEGER NOT NULL,
	"no_sapi"	VARCHAR(255) NOT NULL,
	"rpf"	INTEGER,
	"perilaku"	INTEGER,
	"ib_ke"	INTEGER,
	"jarak_ib"	INTEGER,
	"laktasi"	INTEGER,
	"ib"	DATE,
	"pkb"	DATE,
	"anggota_id"	INTEGER,
	"created_at"	DATETIME,
	"updated_at"	DATETIME,
	FOREIGN KEY("anggota_id") REFERENCES "anggota"("id"),
	PRIMARY KEY("id")
);
DROP TABLE IF EXISTS "role_users";
CREATE TABLE IF NOT EXISTS "role_users" (
	"user_id"	INTEGER,
	"role_id"	INTEGER,
	FOREIGN KEY("role_id") REFERENCES "role"("id"),
	FOREIGN KEY("user_id") REFERENCES "user"("id")
);
DROP TABLE IF EXISTS "anggota";
CREATE TABLE IF NOT EXISTS "anggota" (
	"id"	INTEGER NOT NULL,
	"no_anggota"	VARCHAR(255),
	"namaanggota"	VARCHAR(255) NOT NULL,
	"wilayah_id"	INTEGER,
	"created_at"	DATETIME,
	"updated_at"	DATETIME,
	PRIMARY KEY("id"),
	FOREIGN KEY("wilayah_id") REFERENCES "wilayah"("id")
);
DROP TABLE IF EXISTS "wilayah";
CREATE TABLE IF NOT EXISTS "wilayah" (
	"id"	INTEGER NOT NULL,
	"namawilayah"	VARCHAR(255) NOT NULL,
	"created_at"	DATETIME,
	"updated_at"	DATETIME,
	PRIMARY KEY("id")
);
DROP TABLE IF EXISTS "user";
CREATE TABLE IF NOT EXISTS "user" (
	"id"	INTEGER NOT NULL,
	"username"	VARCHAR(64),
	"password"	VARCHAR(128),
	"last_login"	DATETIME,
	"created_at"	DATETIME,
	"updated_at"	DATETIME,
	PRIMARY KEY("id")
);
DROP TABLE IF EXISTS "role";
CREATE TABLE IF NOT EXISTS "role" (
	"id"	INTEGER NOT NULL,
	"name"	VARCHAR(20) UNIQUE,
	PRIMARY KEY("id")
);
DROP INDEX IF EXISTS "ix_sapi_no_sapi";
CREATE INDEX IF NOT EXISTS "ix_sapi_no_sapi" ON "sapi" (
	"no_sapi"
);
DROP INDEX IF EXISTS "ix_anggota_namaanggota";
CREATE INDEX IF NOT EXISTS "ix_anggota_namaanggota" ON "anggota" (
	"namaanggota"
);
DROP INDEX IF EXISTS "ix_wilayah_namawilayah";
CREATE INDEX IF NOT EXISTS "ix_wilayah_namawilayah" ON "wilayah" (
	"namawilayah"
);
DROP INDEX IF EXISTS "ix_user_username";
CREATE UNIQUE INDEX IF NOT EXISTS "ix_user_username" ON "user" (
	"username"
);
DROP VIEW IF EXISTS "dataset";
CREATE VIEW dataset
AS
SELECT
inseminasi.rpf,
inseminasi.perilaku,
inseminasi.ib_ke,
inseminasi.jarak_ib,
inseminasi.laktasi,
pkb.ib_hasil
FROM
inseminasi
INNER JOIN pkb ON pkb.inseminasi_id = inseminasi.id;
COMMIT;
